import React from 'react';
import './navMenu.css';
import img from './img/calc.jpg';

function Menu (){
    return (
        <nav className="menu">
            <div className="menu-logo">
                <img src="https://www.freepnglogos.com/uploads/calculator-png/calculator-png-logo-clipart-calculator-png-image-5.png" alt="logo"/>
            </div>
            <div className="menu-op">
                <ul>
                    <li>Home</li>
                    <li>Calculadora</li>
                    <li>Sobre</li>
                </ul>
            </div>
        </nav>
    );
};
export default Menu;
